import React from "react";
import classes from "./Product.module.css";

const Product = props => (
    <div className={classes.Product}>
        <h2>Олія Соняшникова</h2>
        <img
            src="https://static.wixstatic.com/media/f99596_4d384386fa134e1a97e3e0897709bc68.png"
            alt="product-preview"
            height="250px"
            width="200px"
        />
        <p className = {classes.Description}>Oхуїтільно смачна олійка!!!</p>
        <h3 className = {classes.OldPrice}>30грн</h3>
        <h2 className = {classes.NewPrice}>25грн</h2>
        <p className = {classes.Discount}>Економія: 18% (5грн)</p>
    </div>
);

export default Product;
